import { Typography } from '@mui/material';
import React from 'react';
import CustomTimeline, { CustomTimelineSeparator } from '../Timeline/Timeline';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';

import resumeData from '../../utils/resumeData.js';
import './Profile.css';
import { TimelineConnector, TimelineContent, TimelineItem, TimelineSeparator } from '@mui/lab';

const CustomTimelineItem = ({ title, text, link }) => (
    <TimelineItem>
    <CustomTimelineSeparator />
    <TimelineContent>
    {link ? (<Typography><span>{title}:</span>{' '}<a href={link} target='_blank'>{text}</a></Typography>) : (
        <Typography><span>{title}:</span>{' '}{text}</Typography>
    )}
    </TimelineContent>
    </TimelineItem>
);


const Profile = () => {
    return (
        <div className='profile container_shadow'>
        <div className='profile_name'>
        <Typography className='name'>{resumeData.name}</Typography>
        <Typography className='title'>{resumeData.title}</Typography>
        </div>

        <figure className='profile_image'>
        <img src={require('../../assets/images/displayImage.jpg')} alt=""/>
        </figure>
        <div className='profile_information'>
        <CustomTimeline icon={<AccountCircleIcon/>}>
        <CustomTimelineItem title='Name' text={resumeData.name} />
        <CustomTimelineItem title='Title' text={resumeData.title} />
        <CustomTimelineItem title='Email' text={resumeData.email} />
        </CustomTimeline>
        <br/>
        <button>button</button>
        </div>
        </div>
    );
};

export default Profile;
